import React from "react";
import TextPicture from "../textpicture/textpicture";

export default function MenuItems({items}){

    items.map(item =>{
        return (
            <>
                <div>{item}</div>
                {/* <TextPicture text={item} pic='arrow.png' containerClass='menu-item-1' textClass='menu-item-heading' picClass='menu-item-img'/> */}
            </>
        )
    })
}
